import s from './bascet.module.css';
import { getCards } from '../../../store/selected';


const Bascet = () => {

    console.log(getCards);

    return (
        <>
            <div className={s.wrapper}>
                <div className={s.text}>
                    <p>name</p>
                    <p>hjhj</p>
                    <p>ghjhj</p>
                </div>
                <div className={s.img}>
                    <img src="data:image/jpeg;base64,"></img>
                </div>
                <div className={s.price}>
                    <h1>price</h1>
                </div>
            </div>
            <div className={s.buy}>
                <h1>Купить сейчас</h1>
                <button>Buy</button>
            </div>
        </>
    );
}

export default Bascet;
